import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'

import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function Home() {
  return (
    <h1>HOME PAGE</h1>
  );
}

function App() {
  return (

    <Router>
      <Switch>
        <Route path='/' exact={true} component={Home}/>
      </Switch>
    </Router>
    // <div className="App">
    //   <h1>HELL1O</h1>
    // </div>
  );
}

export default App;
